//import Modal from './Modal.js';
import React from 'react';
import axios from 'axios';
import './stats.css'


export default class Stats extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
          requiredItem: 0,
          collectionOfstats: [],
          sessions: []
        }

        this.exampleState = {
            requiredItem: 0,
            collection: [
              {
                actionName: 'pass file',
                sessionType: 'RX',
                nameOfFile: '/home/Ishay/Ishayhamaniac.txt',
                syncDirectory: '/home/Ishay',
                result: 'Success'
              }, 
              {
                actionName: 'pass file',
                sessionType: 'RX',
                nameOfFile: '/home/Ishayhamaniac.txt',
                syncDirectory: '/home/Ishay',
                result: 'Success'
              }, 
              {
                actionName: 'pass file',
                sessionType: 'RX',
                nameOfFile: '/home/Ishayhamaniac.txt',
                syncDirectory: '/home/Ishay',
                result: 'Success'
              }
            ]
          }
      }
    componentDidMount() 
    {
        //This method will ask server for stats.
    }

    render(){
        console.log("Arriving here");
        const collection = this.exampleState.collection.map((item, index) =>{
            return(
                <tr key={index}>
          <td>{item.actionName}</td>
          <td>{item.sessionType}</td>
          <td>{item.nameOfFile}</td>
          <td>{item.syncDirectory}</td>
          <td>{item.result}</td>
        </tr>

            )
        })

        return(
            <div>
                <div style={{ textAlign: "center" }}>
                    <h1>Pillar of Salt Statistics</h1>
                </div>
                <table className="table table-striped">
                    <thead>
                        <tr>
                        <th scope="col"> Action</th>
                        <th scope="col">Session Type</th>
                        <th scope="col">Name of File/Directory</th>
                        <th scope="col">Sync Directory</th>
                        <th scope="col">result</th>
                        </tr>
                    </thead>
                    <tbody>
                    { collection }
                    </tbody>
                </table>
            </div>)
    }
}

